//Main app entry

// src/App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage';
// Import other components for different pages
// import GenerateTeam from './components/GenerateTeam';
// import FetchTeam from './components/FetchTeam';
// import SuggestTransfers from './components/SuggestTransfers';

function App() {
    return (
        <Router>
            <div>
                <Routes>
                    <Route path="/" element={<HomePage />} />
                    <Route path="/generate-team" element={<div>Generate Team Page</div>} />
                    <Route path="/fetch-team" element={<div>Fetch Team by Name Page</div>} />
                    <Route path="/suggest-transfers" element={<div>Suggest Transfers Page</div>} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
